import axios from "axios";

const AddPlan = async ({ content }) => {
    const address = content; //content 제대로 전달안됨. 이거 수정하고 추가기능 완료하고 제거기능이랑 마이플랜에서 버튼이동기능, 빌딩네임문제 수정해야함. 그 이후에 css.
    const memo = "";
    const content_id = 1;
    const user_content_list = [address, memo, content_id];
    console.log()
    try {
        await axios.post('http://localhost:8000/api/add_plan', content, {
            headers: {
                'Content-Type': 'application/json',
            },
        });
        console.log('Plan added successfully');
    } catch (error) {
        console.error('Error adding plan:', error);
    }
}

export default AddPlan;
